import useInput from './logic'
import React from "react";
import useCaryca from './calc'
function App() {
  const [username, usernameInput] = useInput({ placeholder: '' });
  const [liczba,liczbakek]=useCaryca({placeholder:""})

  return (
    
      <form onChange={useInput}>
        <div className='app'>
      {usernameInput}
      <p>{username}</p>
      {liczba}
      <p>{liczbakek}</p>
      </div>
    </form>
  );

}
export default App
